import React from 'react';
import {
    Container,
    Row,
    Col
} from 'reactstrap'
import bgpj1 from './img/bg-pj1.jpg'

export default class Page3 extends React.Component {
    render() {
        return (
            <Container className="containerpage3">
                <Row>
                    <img src={bgpj1} className="bgpj1" alt="bgimg-project1" />
                    <Col>

                    </Col>
                </Row>
            </Container>
        );
    }
}
